Defendant Anna L. Born in court, in custody with attorney Bradley Joseph Jansen.  Gilbert Grant Thompson appeared for the State of Wisconsin. Agent Jana Herron appears, heard. Court has reviewed previous statements of interested parties and letter from defendant's significant other. Atty Thompson heard. Atty Jansen heard. Defendant makes statement. Court heard and imposes sentence:

Ct 1:
1 year Initial Confinement, consecutive;
3 years ES, consecutive;
62 days presentence credit;

Ct 3:
1 year Initial Confinement, consecutive;
3 years ES, consecutive;

Eligible for Substance Abuse and Challenge Incarceration Programs;
Court enters civil judgment for unpaid restitution and costs still owing;
